// Hi工具箱
var HiTool = {
    //匹配身份证
	regExpIDCard: function(str) {
		return /^[1-9]\d{7}((0\d)|(1[0-2]))(([0|1|2]\d)|3[0-1])\d{3}$|^[1-9]\d{5}[1-9]\d{3}((0\d)|(1[0-2]))(([0|1|2]\d)|3[0-1])\d{3}([0-9]|X)$/.test(str);
	},
	//匹配手机号
	regExpPhone: function(str) {
		return /^1[23456789]\d{9}$/.test(str);
	},
	//匹配邮箱格式
	regExpEmail: function(str) {
		return /^\w+([-+.]\w+)*@\w+([-.]\w+)*\.\w+([-.]\w+)*$/.test(str);
	},
	//匹配域名
	regExpRealmName: function(str) {
		return /[a-zA-Z0-9][-a-zA-Z0-9]{0,62}(\/.[a-zA-Z0-9][-a-zA-Z0-9]{0,62})+\/.?/.test(str);
	},
	//匹配InternetURL
	regExpInternetURL: function(str){
		return /http(s)?:\/\/([\w-]+\.)+[\w-]+(\/[\w- .\/?%&=]*)?/.test(str);
	},
	//匹配密码（密码(以字母开头，长度在6~18之间，只能包含字母、数字和下划线)）
	regExpPwd: function(str){
		return /^[a-zA-Z]\w{5,17}$/.test(str);
	},
	//日期格式  2019-01-12
	regExpDate: function(str){
		return /^\d{4}-\d{1,2}-\d{1,2}/.test(str);
	},
    // 设置cookie,cname cookie名,cvalue cookie值,exdays 过期天数
    setCookie: function(cname, cvalue, exdays) {
        var d = new Date();
        d.setTime(d.getTime() + (exdays * 24 * 60 * 60 * 1000));
        var expires = "expires=" + d.toGMTString();
        document.cookie = cname + "=" + cvalue + "; " + expires;
    },
    // 获取cookie,cname cookie名
    getCookie: function(cname) {
        var name = cname + "=";
        var ca = document.cookie.split(';');
        for (var i = 0; i < ca.length; i++) {
            var c = ca[i].trim();
            if (c.indexOf(name) == 0) { return c.substring(name.length, c.length); }
        }
        return "";
    },
    // 倒计时,endtime 结束时间,nowtime 开始时间,默认值时当前时间
    countDown: function(endtime,nowtime){
        var day = 0,
          hour = 0,
          minute = 0,
          second = 0, //时间默认值
          newtime = nowtime || new Date().valueOf()/1000,
          times = endtime - newtime;
        if (times > 0) {
          day = Math.floor(times / (60 * 60 * 24));
          hour = Math.floor(times / (60 * 60)) - (day * 24);
          minute = Math.floor(times / 60) - (day * 24 * 60) - (hour * 60);
          second = Math.floor(times) - (day * 24 * 60 * 60) - (hour * 60 * 60) - (minute * 60);
        }
        day <= 9 ? day = '0' + day : null;
        hour <= 9 ? hour = '0' + hour : null;
        minute <= 9 ? minute = '0' + minute : null;
        second <= 9 ? second = '0' + second : null;
        return {day,hour,minute,second}
    }
}


/*
插件：视频弹窗
版本：
官网：
*/
function HiVideoPop(obj) {
    var oVideoBox = $("#hi-video-pop"); //弹窗
    var oClose = oVideoBox.find(".hi-close"); //关闭按钮
    var oVideo = oVideoBox.find("video"); //视频标签
    var oVideoBox2 = $("#hi-iframe-video"); //iframe弹窗
    var oClose2 = oVideoBox2.find(".hi-close"); //iframe关闭按钮
    // 点击显示弹窗，设置视频src，播放视频
    $(document).on("click",obj,function(){
        if($(this).attr("data-video-src")){
            if($(this).attr("data-video-src").indexOf("iframe")>0){
                oVideoBox2.stop().fadeIn();
                oVideoBox2.append($(this).attr("data-video-src"));
            }else{
                oVideoBox.stop().fadeIn();
                oVideo.attr("src", $(this).attr("data-video-src"));
                oVideo.trigger("play");
            }
        }
    });
    // 点击关闭弹窗，暂停视频播放
    oClose.click(function(event) {
        event.stopPropagation();
        oVideoBox.stop().fadeOut();
        oVideo.trigger("pause");
    });
    // 点击弹窗，暂停视频播放
    oVideoBox.click(function(event) {
        event.stopPropagation();
        oVideoBox.stop().fadeOut();
        oVideo.trigger("pause");
    });
    // 点击关闭iframe弹窗，清除iframe
    oClose2.click(function(event) {
        event.stopPropagation();
        oVideoBox2.stop().fadeOut();
        oVideoBox2.find("iframe").remove();
    });
    // 点击iframe弹窗，清除iframe
    oVideoBox2.click(function(event) {
        event.stopPropagation();
        oVideoBox2.stop().fadeOut();
        oVideoBox2.find("iframe").remove();
    });
}


/*
插件：视频全屏
版本：
官网：
*/
function HiVideoPop2(obj) {
    var oVideo = $("#hi-video-pop2"); //视频
    // 点击视频全屏，设置视频src，播放视频
    $(document).on("click",obj,function(){
        if($(this).attr("data-video-src")){
            if (oVideo[0].requestFullscreen) {
                oVideo[0].requestFullscreen();
            } else if (oVideo[0].msRequestFullscreen) {
                oVideo[0].msRequestFullscreen();
            } else if (oVideo[0].mozRequestFullScreen) {
                oVideo[0].mozRequestFullScreen();
            } else if (oVideo[0].webkitRequestFullScreen) {
                oVideo[0].webkitRequestFullScreen();
            }
            oVideo.show();
            oVideo.attr("src", $(this).attr("data-video-src"));
            oVideo.trigger("play");
        }
    });
    $(window).resize(function() {
        if (oVideo.outerHeight() == 0) {
            oVideo.hide();
            oVideo.trigger("pause");
        }
    });
}

/*
插件：图片弹窗
版本：
官网：
*/
function HiImgPop(obj) {
    var oImgBox = $("#hi-img-pop"); //弹窗
    var oClose = oImgBox.find(".hi-close"); //关闭按钮
    var oImg = oImgBox.find("img"); //图片标签
    // 点击显示弹窗，设置图片src
    $(document).on("click",obj,function(){
        if($(this).attr("data-img-src")){
            oImgBox.stop().fadeIn();
            oImg.attr("src", $(this).attr("data-img-src"));
        }
    });
    // 点击图片阻止冒泡
    oImg.click(function(event) {
        event.stopPropagation();
    });
    // 点击关闭弹窗
    oClose.click(function(event) {
        event.stopPropagation();
        oImgBox.stop().fadeOut();
    });
    // 点击弹窗关闭弹窗
    oImgBox.click(function(event) {
        event.stopPropagation();
        oImgBox.stop().fadeOut();
    });
}


/*
插件：简历弹窗
版本：
官网：
*/
function HiResumePop(obj,sText) {
    var oResumeBox = $("#hi-resume-pop"); //弹窗
    var oClose = oResumeBox.find(".hi-close"); //关闭按钮
    var oText = oResumeBox.find(".hi-text"); //上传简历名
    var oInput = oResumeBox.find(".hi-file"); //上传文本框
    var oForm = oResumeBox.find("form");//form
    var sFileName = "";
    // 点击显示简历弹窗
    $(document).on("click",obj,function(){
        oResumeBox.stop().fadeIn();
    })
    // 点击form阻止冒泡
    oForm.click(function(event) {
        event.stopPropagation();
    });
    // 点击弹窗，隐藏简历弹窗
    oResumeBox.click(function(event) {
        event.stopPropagation();
        oResumeBox.stop().fadeOut();
    });
    // 点击关闭按钮，隐藏简历弹窗
    oClose.click(function(event) {
        event.stopPropagation();
        oResumeBox.stop().fadeOut();
    });
    // 设置上传文件名
    oInput.change(function(event) {
        sFileName = $(this).val().split('\\');
        sFileName = sFileName[sFileName.length - 1];
        oText.text(sText + sFileName);
    });
}


