function HiVideoPlay(obj1,obj2,nNum,bOnce) {
    if (obj1.length != 0) {
        obj2.each(function(){
            var a = true;
            var b = true;
            var _this = $(this);
            var timer = null;
            $(window).scroll(function() {
                fn1();
            });
            function fn1(){
                if(b){
                    if ($(window).scrollTop() >= obj1.offset().top - $(window).height() + $(window).height()*nNum && $(window).scrollTop()<obj1.offset().top + obj1.outerHeight()) {
                        if(a){
                            a = false;
                            if(bOnce){
                                b = false;
                            }
                            if(_this.parents(".swiper-slide").length>0){
                                if(_this.parents(".swiper-slide-active").length>0||_this.parents(".swiper-slide-thumb-active").length>0){
                                    _this.trigger("play");
                                }
                            }else{
                                _this.trigger("play");
                            };
                        }
                    }else{
                        a = true;
                        _this[0].currentTime = 0;
                        _this.trigger("pause");
                    }
                }
            }
            timer=setTimeout(function(){
                fn1();
                clearTimeout(timer);
            },500);
        });
    }
}


